import React from 'react';

const card=(props)=>{
    const{name,email,id}=props;
    return(
        <div className='tc bg-light-blue dib br3 pa3 ma2 grow bw2 shadow-5'>
            <img alt='robofriends' src={`https://robohash.org/${id}?200*200`}/>
            <div>
                <h2>{name}</h2>
                <p>{email}</p>
            </div>
        </div>
    );
}

export default card;
